<p><hi rend="bold">فۇجيەن ئۆلكىسى</hi> بولسا <ref target="https://ug.wikipedia.org/wiki/جۇڭخۇا_خەلق_جۇمھۇرىيىتى">جۇڭخۇا خەلق جۇمھۇرىيىتى</ref> دىكىبىخاھار 2005 نوپۇس بار، فۇجيەننىڭ 35،110،000 نوپۇسىبار، 121،400 كم² دائىرائىقىدا نوپۇس جايلاخكان، خىمالىكاڭ لىك 26.33°، خارىكى ئۇزۇنلۇك 117°51.</p>
